import React from "react";
import { Box, Typography, TextField, Button, Paper, Link } from "@mui/material";
import { useForm } from "react-hook-form";
const Signup = () => {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const onSubmit = (data) => {
    console.log(data);
  };

  return (
    <Box className="LoginForm">
      <Box className="form">
        <Typography variant="h5" className="loginText">
          Login
        </Typography>
        <form onSubmit={handleSubmit(onSubmit)}>
          <Box className="coverTextField">
            <TextField
              id="standard-basic"
              label="Email"
              variant="outlined"
              className="inputLogin"
              defaultValue=""
              fullWidth
              {...register("email")}
              // error="true"
              // helperText="this is error" 
            />
          </Box>
          <Box className="coverTextField">
            <TextField
              id="standard-basic"
              label="Password"
              variant="outlined"
              type="password"
              className="inputLogin"
              defaultValue=""
              fullWidth
              {...register("password")}
              // error="true"
              // helperText="this is error"
            />
          </Box>
          <Button variant="contained" className="buttonLogin" type="submit">
            Log In
          </Button>
          <br></br>
          <Typography variant="p" className="registerText">
            Do you have account ?
            <Link href="/register" className="registerLink">
              Signup
            </Link>
          </Typography>
        </form>
      </Box>
    </Box>
  );
};

export default Signup;
